import React, { useState, useEffect, useRef } from 'react';
import { PageContainer, ProTable } from '@ant-design/pro-components';
import { Button, Space } from 'antd';
import { PlayCircleOutlined } from '@ant-design/icons';
import type { ProColumns } from '@ant-design/pro-components';
import LogViewer, { LogEntry } from '@/components/LogViewer';
import { logger } from '@/utils/logger';
import { deviceApi } from '@/services/api';
import { wsService } from '@/services/websocket';

interface DeviceItem {
  id: string;
  name: string;
  status: 'online' | 'offline';
  lastOnline?: string;
}

const DeviceList: React.FC = () => {
  const [logs, setLogs] = useState<LogEntry[]>([]);
  const initializedRef = useRef(false);
  const unsubscribeDeviceListRef = useRef<(() => void) | null>(null);

  useEffect(() => {
    // 防止重复初始化
    if (initializedRef.current) {
      return;
    }
    initializedRef.current = true;

    // 订阅日志 - 先获取当前日志，避免立即触发更新
    const currentLogs = logger.getLogs();
    setLogs(currentLogs);

    const unsubscribe = logger.subscribe((newLogs) => {
      // 使用setTimeout避免在渲染期间触发状态更新
      setTimeout(() => {
        setLogs(newLogs);
      }, 0);
    });

    // 延迟初始化，避免在useEffect中立即触发状态更新
    const timer = setTimeout(() => {
      // 连接WebSocket
      if (!wsService.isConnected()) {
        wsService.connect();
      }

      // 监听设备列表更新
      unsubscribeDeviceListRef.current = wsService.on('device_list', () => {
        logger.info('收到设备列表更新');
      });

      // 初始化日志
      logger.info('设备列表页面加载');
      logger.info('正在获取设备列表...');
    }, 100);

    return () => {
      clearTimeout(timer);
      unsubscribe();
      if (unsubscribeDeviceListRef.current) {
        unsubscribeDeviceListRef.current();
        unsubscribeDeviceListRef.current = null;
      }
      initializedRef.current = false;
    };
  }, []);

  const columns: ProColumns<DeviceItem>[] = [
    {
      title: '设备ID',
      dataIndex: 'id',
      key: 'id',
    },
    {
      title: '设备名称',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: '状态',
      dataIndex: 'status',
      key: 'status',
      valueEnum: {
        online: { text: '在线', status: 'Success' },
        offline: { text: '离线', status: 'Default' },
      },
    },
    {
      title: '最后在线',
      dataIndex: 'lastOnline',
      key: 'lastOnline',
    },
    {
      title: '操作',
      key: 'action',
      render: (_, record) => (
        <Space>
          <Button
            type="primary"
            icon={<PlayCircleOutlined />}
            onClick={() => {
              logger.info(`准备连接设备: ${record.name}`);
              window.location.href = `/device/control/${record.id}`;
            }}
          >
            远程控制
          </Button>
        </Space>
      ),
    },
  ];

  return (
    <PageContainer>
      <ProTable<DeviceItem>
        columns={columns}
        request={async () => {
          try {
            logger.info('请求设备列表数据');
            const response = await deviceApi.getDeviceList();
            return {
              data: response.data || [],
              success: true,
              total: response.data?.length || 0,
            };
          } catch (error: any) {
            logger.error(`获取设备列表失败: ${error.message}`);
            return {
              data: [],
              success: false,
              total: 0,
            };
          }
        }}
        rowKey="id"
        search={false}
        toolBarRender={() => [
          <Button 
            key="refresh" 
            onClick={async () => {
              logger.info('刷新设备列表');
              // 重新请求数据
              window.location.reload();
            }}
          >
            刷新
          </Button>,
        ]}
      />

      <div style={{ marginTop: 24 }}>
        <LogViewer 
          logs={logs} 
          title="设备管理日志"
          onClear={() => logger.clearLogs()}
        />
      </div>
    </PageContainer>
  );
};

export default DeviceList;

